﻿using Currency from './Currency';
using Id from './Currency';

		entity Bank {
			key bid : Id;
			name : String(100);
			createdby: String(100);
			createdon: String(30);

			toBankCurrency : association to many BankCurrency on toBankCurrency.bid = bid;
		};

		entity BankCurrency {
			key bid : Id;
			key cuid : Id;
			createdby: String(100);
			createdon: String(30);

			toCurrency : association to one Currency on toCurrency.cuid = cuid;
			toBank : association to one Bank on toBank.bid = bid;
		};

		entity Course {
			key coid : Integer;
			cuid : Integer;
			date : String(30);
			value : String(10);
    		createdby: String(100);
			createdon: String(30);

			toCurrency : association to one Currency on toCurrency.cuid = cuid;
		};

		entity Log {
		    key loid : Integer;
		    text : String(200);
			createdby: String(20);
			createdon: String(30);
		};

﻿type Id : Integer;
using BankCurrency from './ExtraInfo';
using Course from './ExtraInfo';

entity Currency {
    key cuid : Id;
    name : String(10);
	createdby: String(100);
	createdon: String(30);

    toCourse : association to many Course on toCourse.cuid = cuid;
    toBankCurrency : association to many BankCurrency on toBankCurrency.cuid = cuid;
	};

using Bank as _Bank from '../db/ExtraInfo';
using Currency as _Currency from '../db/Currency';
using Course as _Course from '../db/ExtraInfo';
using Log as _Log from '../db/ExtraInfo';
using BankCurrency as _BankCurrency from '../db/ExtraInfo';

service odata {

  entity bank @(
		title: 'bank',
		Capabilities: {
			InsertRestrictions: {Insertable: false},
			UpdateRestrictions: {Updatable: false},
			DeleteRestrictions: {Deletable: false}
		}
	) as projection on _Bank;

	  entity bankCurrency @(
		title: 'bankCurrency',
		Capabilities: {
			InsertRestrictions: {Insertable: false},
			UpdateRestrictions: {Updatable: false},
			DeleteRestrictions: {Deletable: false}
		}
	) as projection on _BankCurrency;

  entity currency @(
		title: 'currency',
		Capabilities: {
			InsertRestrictions: {Insertable: false},
			UpdateRestrictions: {Updatable: false},
			DeleteRestrictions: {Deletable: false}
		}
	) as projection on _Currency;

    entity course @(
		title: 'course',
		Capabilities: {
			InsertRestrictions: {Insertable: false},
			UpdateRestrictions: {Updatable: false},
			DeleteRestrictions: {Deletable: false}
		}
	) as projection on _Course;

		entity log @(
		title: 'log',
		Capabilities: {
			InsertRestrictions: {Insertable: false},
			UpdateRestrictions: {Updatable: false},
			DeleteRestrictions: {Deletable: false}
		}
	) as projection on _Log;
}
